//****************************** DRAW FUNCTIONS
//********************************************** */

void drawPixel(int x, int y, short int color) {
  volatile short int *one_pixel_address;
  one_pixel_address = (short int *)(pixel_buffer_start + (y << 10) + (x << 1));
  *one_pixel_address = color;
  return;
}

void drawPiece(int x, int y, short int color, int radius) {
  for (int j = y - radius; j <= y + radius; j++) {
    for (int i = x - radius; i <= x + radius; i++) {
      if (((i - x) * (i - x) + (j - y) * (j - y)) <= radius * radius) {
        drawPixel(i, j, color);
      }
    }
  }
}

void drawArrow(int x, int y, int fact) {
  for (int i = 0; i < 20; i++) {
    for (int j = -i; j <= i; j++) {
      drawPixel(x + j, y + fact * i, 0xf800);
    }
  }
}

void clearScreen() {
  int y, x;
  for (x = 0; x < 512; x++) {
    for (y = 0; y < 240; y++) {
      drawPixel(x, y, 0);
    }
  }
}

void backgroundPlot() {
  clearScreen();
  for (int x = 0; x < WIDTH; x++) {
    for (int y = 0; y < HEIGHT; y++) {
      int ind = y * WIDTH + x;
      short int color = back[ind];
      drawPixel(x, y, color);
    }
  }
  drawPiece(260, 50, 0, 30);
  drawPiece(260, 180, 0xffff, 30);
}

void drawArrowCursor(int x, int y) {
  for (int i = 0; i < 8; i++) {
    for (int j = -i; j <= i; j++) {
      if (x + j >= 0 && x + j < WIDTH && y + i >= 0 && y + i < HEIGHT) {
        drawPixel(x + j, y + i, 0xf800);
      }
    }
  }
  for (int i = 0; i < 6; i++) {
    for (int j = -2; j <= 2; j++) {
      if (x + j >= 0 && x + j < WIDTH && y + 8 + i >= 0 && y + 8 + i < HEIGHT) {
        drawPixel(x + j, y + 8 + i, 0xf800);
      }
    }
  }
}

void waitForVsync() {
  int status;
  *pixel_ctrl_ptr = 1;
  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

void piecesPlot() {
  for (int i = 0; i < 8; i++) {
    for (int j = 0; j < 8; j++) {
      short int color = 0xffff;
      if (gameBoard[i][j] != 0) {
        if (gameBoard[i][j] == -1) {
          color = 0;
        }
        drawPiece(FIRSTX + i * SHIFT, FIRSTY + j * SHIFT, color, 9);
      }
    }
  }
}

void drawValidCircle(int x, int y, int radius) {
  for (int j = y - radius; j <= y + radius; j++) {
    for (int i = x - radius; i <= x + radius; i++) {
      if (((i - x) * (i - x) + (j - y) * (j - y)) >=
              (radius - 1) * (radius - 1) &&
          ((i - x) * (i - x) + (j - y) * (j - y)) <= radius * radius) {
        drawPixel(i, j, 0x2fe5);
      }
    }
  }
}
