//***************************** GAMEPLAY FUNCS
//************************************
bool positionInBounds(int row, int col) {
  return (col >= 0 && col < 8 && row >= 0 && row < 8);
}

int setFirstPlayer() { return (rand() % 2) ? 1 : -1; }

bool checkLegalInDirection(int row, int col, int color, int deltaRow,
                           int deltaCol) {
  int opp_color = color * -1;

  // if current position is occupied or out-of-bounds, return false
  if (gameBoard[row][col] != EMPTY || !positionInBounds(row, col)) {
    return false;
  }

  // move to adjacent squarev
  int newRow = row + deltaRow;
  int newCol = col + deltaCol;

  // if new position out of bounds, if a player's piece is already there, or if
  // it is empty, return false
  if ((!positionInBounds(newRow, newCol)) ||
      gameBoard[newRow][newCol] == color ||
      gameBoard[newRow][newCol] == EMPTY) {
    return false;
  }

  // while the new position is in-bounds and there is an opponent's piece in the
  // direction we are travelling, keep checking in that direction, as it is
  // valid
  while ((positionInBounds(newRow, newCol)) &&
         (gameBoard[newRow][newCol] == opp_color)) {
    newRow += deltaRow;
    newCol += deltaCol;
  }
  // while loop just exited either because position is out-of-bounds, or because
  // it encountered a non-opponent piece at this point, (newRow, newCol)
  // represent the position immediately after the last opponent piece in that
  // direction

  // check again if new position is out-of-bounds
  if (!positionInBounds(newRow, newCol)) {
    return false;
  }

  // if opponent's pieces have been sandwiched, return true
  if (gameBoard[newRow][newCol] == color) {
    return true;
  }

  return false;
}

void displayLegalMoves(int row, int col, int color) {
  // check all legal moves in all directions and draw circles indicating valid
  // moves
  for (int deltaRow = -1; deltaRow <= 1; deltaRow++) {
    for (int deltaCol = -1; deltaCol <= 1; deltaCol++) {
      if (checkLegalInDirection(row, col, color, deltaRow, deltaCol)) {
        drawValidCircle(FIRSTX + SHIFT * row, FIRSTY + SHIFT * col,
                        PIECE_RADIUS);
      }
    }
  }
}

bool isLegalMove(int row, int col, int color) {
  for (int deltaRow = -1; deltaRow <= 1; deltaRow++) {
    for (int deltaCol = -1; deltaCol <= 1; deltaCol++) {
      if (checkLegalInDirection(row, col, color, deltaRow, deltaCol))
        return true;
    }
  }
  return false;
}

bool hasLegalMoves(int color) {
  for (int row = 0; row < 8; row++) {
    for (int col = 0; col < 8; col++) {
      if (isLegalMove(row, col, color)) {
        return true;
      }
    }
  }
  return false;
}

int squareContents(int row, int col) { return gameBoard[row][col]; }

void flipTiles(int row, int col, int color) {
  // going in all eight directions surrounding a given square
  for (int deltaRow = -1; deltaRow <= 1; deltaRow++) {
    for (int deltaCol = -1; deltaCol <= 1; deltaCol++) {
      if (checkLegalInDirection(row, col, color, deltaRow, deltaCol)) {
        int newRow = row + deltaRow;
        int newCol = col + deltaCol;

        while (gameBoard[newRow][newCol] != color) {
          gameBoard[newRow][newCol] = color;
          newRow += deltaRow;
          newCol += deltaCol;
        }
      }
    }
  }

  return;
}

//***************** MOUSE MAPPING FUNC ****************
int *extractField(int x, int y) {
  int *coord = malloc(2 * sizeof(int));
  if (x < BOX_X || y < BOX_Y || x > 8 * BOXSHIFT + BOX_X ||
      y > 8 * BOXSHIFT + BOX_Y) {
    coord[0] = -1;
    coord[1] = -1;
  } else {
    coord[0] = (int)((x - BOX_X) / BOXSHIFT);
    coord[1] = (int)((y - BOX_Y) / BOXSHIFT);
  }
  return coord;  // Return pointer to allocated memory
}

//***********GAME MAIN LOGIC*************

short int Buffer1[240][512];
short int Buffer2[240][512];

int main(void) {  // need to integrate with 2d player arrays later
  srand(time(NULL));
  int x = 21;
  int y = 37;

  unsigned char byte1 = 0;
  unsigned char byte2 = 0;
  unsigned char byte3 = 0;

  volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 port address

  int PS2_data, RVALID;
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
  waitForVsync();
  pixel_buffer_start = *pixel_ctrl_ptr;
  clearScreen();

  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  clearScreen();

  int color = setFirstPlayer();
  if (color == WHITE) {
    gameBoard[3][3] = WHITE;
    gameBoard[4][4] = WHITE;
    gameBoard[3][4] = BLACK;
    gameBoard[4][3] = BLACK;
  }

  while (1) {                         // Main code
    backgroundPlot();                 // Plot background image
    piecesPlot();                     // Plot game pieces
    calc_score(248, 40, 0xffff, -1);  // Black center
    calc_score(248, 170, 0x0000, 1);  // WHTTE center

    for (int i = 0; i < 8; i++) {
      for (int j = 0; j < 8; j++) {
        if (gameBoard[i][j] == 0) {
          displayLegalMoves(i, j, color);
        }
      }
    }

    //****************************************  MOUSE CODE
    //***************************************

    int changex = 0;
    int changey = 0;
    static bool prev_left = false;

    while (1) {
      PS2_data = *(PS2_ptr);         // read the Data register in the PS/2 port
      RVALID = (PS2_data & 0x8000);  // extract the RVALID field
      if (RVALID != 0) {
        /* always save the last three bytes received */
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;
        fifo_counter++;
        if (fifo_counter % 3 == 0) {
          int x_sign = byte1 & 0x10;
          int y_sign = byte1 & 0x20;

          bool left = byte1 & 0x01;
          bool xdir = (byte1 >> 4) & 0x01;

          if (xdir == 0) {
            changex = byte2;
          } else {
            int sign_ext = 0xFFFFFF00 + byte2;
            changex = sign_ext;
          }

          if (x_sign == 0) {
            changex = byte2;
          } else {
            int sign_ext = 0xFFFFFF00 + byte2;
            changex = sign_ext;
          }

          if (y_sign == 0) {
            changey = byte3;
          } else {
            int sign_ext = 0xFFFFFF00 + byte3;
            changey = sign_ext;
          }

          x += changex;
          y -= changey;

          // vga monitor boundaries
          if (x < 0) x = 0;
          if (x > 319) x = 319;
          if (y < 0) y = 0;
          if (y > 239) y = 239;

          if (left && !prev_left) {
            int *boxClick = extractField(x, y);
            if (boxClick) {
              int rowMove = boxClick[0];
              int colMove = boxClick[1];
              if (isLegalMove(rowMove, colMove, color)) {
                flipTiles(rowMove, colMove, color);
                gameBoard[rowMove][colMove] = color;
                color *= -1;  // switch color
              }
              free(boxClick);
            }
          }

          prev_left = left;  // Update previous state
          fifo_counter = 0;
        }
        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
          // mouse inserted; initialize sending of data
          *(PS2_ptr) = 0xF4;
        }
      } else {
        break;
      }
    }
    if (!hasLegalMoves(color)) {
      color *= -1;
      if (!hasLegalMoves(color)) printf("Game over, broke out of mouse loop\n");
      break;  // No moves for both players, game over
    }
    drawArrowCursor(x, y);
    if (color == BLACK) {
      drawArrow(260, 85, 1);
    } else if (color == WHITE) {
      drawArrow(260, 145, -1);  // White
    }

    //*****************************************************************************************

    waitForVsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  }
  printf("Outside of mouse loop, calculating score now\n");
  int scoreBlack = 0, scoreWhite = 0;
  for (int i = 0; i < 8; i++) {
    for (int j = 0; j < 8; j++) {
      if (gameBoard[i][j] == 1) {
        printf("White +1\n");
        scoreWhite++;
      }
      if (gameBoard[i][j] == -1) {
        scoreBlack++;
        printf("Black +1, new black score is: %d\n", scoreBlack);
      }
    }
  }
  if (scoreBlack > scoreWhite) {
    printf("Black wins\n");
    clearScreen();
    for (int x = 0; x < WIDTH; x++) {
      for (int y = 0; y < HEIGHT + 1; y++) {
        int ind = y * WIDTH + x;
        short int color = black_wins[ind];
        drawPixel(x, y, color);
      }
    }
    waitForVsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

  } else {
    clearScreen();
    for (int x = 0; x < WIDTH - 1; x++) {
      for (int y = 0; y < HEIGHT - 1; y++) {
        int ind = y * WIDTH + x;
        short int color = white_wins[ind];
        drawPixel(x, y, 0x0);
      }
    }
    waitForVsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  }
  return 0;
}
